      .then(res => res.text())
      .then(res => setState({ apiResponse: res }));
}

function componentWillMount(){
  callAPI();
}

function App () {
  const apiResponse = useState("");
  return (
    <div className = "App">
      <h2> {apiResponse} </h2>
    </div>
  )
}

export default App;
